import Generation from '../../../assets/data/Generation'

const Generations = ({ generations, changeGeneration }) => {

    Generation.map(gen => {
        return <button onClick={() => changeGeneration(gen.name)}>{gen.number}</button>
    })

    return (
        <div>
            <button onClick={() => changeGeneration('yellow')}>I</button>
            <button onClick={() => changeGeneration('crystal')}>II</button>
            <button onClick={() => changeGeneration('emerald')}>III</button>
            <button onClick={() => changeGeneration('heartgold-soulsilver')}>IV</button>
            <button onClick={() => changeGeneration('black-2-white-2')}>V</button>
            <button onClick={() => changeGeneration('x-y')}>VI</button>
            <button onClick={() => changeGeneration('sun-moon')}>VII</button>
        </div>
    )
}

export default Generations
